### Summary of Core Topics, Concepts, Principles, and Equations

The exam focuses on English language skills, including vocabulary, grammar, comprehension, and communication. Here are the core topics and concepts to study:

#### Vocabulary
- **Synonyms and Antonyms**: Understanding and identifying words with similar or opposite meanings.
  - Example: Synonym of "surpassed" is "exceed."
- **Word Collocations**: Common word pairings.
  - Example: "Bank Account," "Strong Coffee," "Lazy Afternoon," "Short Temper," "Ancient Ruins."
- **Phrasal Verbs**: Understanding and using multi-word verbs.
  - Example: "Call by," "Broke up."

#### Grammar
- **Parts of Speech**: Identifying nouns, pronouns, verbs, adjectives, adverbs, conjunctions, and prepositions.
  - Example: In "Raghav is going for a walk," "Raghav" is a noun.
- **Verb Tenses**: Using correct verb forms in different tenses.
  - Example: "They bought the house last year."
- **Articles**: Using "a," "an," and "the" correctly.
  - Example: "He gave me a book on my birthday," "The Sun rises in the east."
- **Adverbs and Adjectives**: Identifying and using adverbs and adjectives.
  - Example: In "Joseph ran faster than everyone else in the relay team," "faster" is an adverb.

#### Comprehension
- **Reading Comprehension**: Understanding and interpreting written passages.
  - Example: Analyzing a passage about the launch of Meta’s Threads and its impact on Twitter.
- **Contextual Meaning**: Understanding the meaning of phrases and words in context.
  - Example: "Taken a hit" means "be affected badly."

#### Communication
- **Telephonic Conversations**: Filling in blanks in a conversation with appropriate responses.
  - Example: Completing a telephonic conversation between Jay and Prateek.
- **Idioms and Phrases**: Understanding common idioms and phrases.
  - Example: "Keep me in the loop" means "keep me updated."

#### Phonetics
- **Sounds and Pronunciation**: Identifying words with specific sounds.
  - Example: Words with "ii" sound (meet, lead, wheat) and "oo" sound (court, loot).
- **Diphthongs**: Identifying words with diphthongs.
  - Example: "Mouth," "South," "Pout" have diphthongs, but "Moot" does not.
- **Semi-vowels**: Identifying semi-vowels in transitions between words.
  - Example: The semi-vowel /y/ occurs in the transition between "me" and "off."

